import React from 'react';
import logo from '../assets/img/logotmc.png';
import { TbLogout } from "react-icons/tb";
import { Link } from 'react-router-dom';
import '../Styles/header.css';

const style = {color:'white', textDecoration:'none'};


export default function Header() {
    return (
        <header>
            <div className='navbar-container'>
                <div className='logo-and-text-container'>
                    <img src={logo} alt='logo'></img>
                    <ul>
                        <li className='list-text'>
                            {/* <Link style={style} to="/"> Planning </Link>  */}
                            <Link Link id="link_Styles" to="/"> Planning </Link> 
                        </li>
                        <li className='list-text'>
                            <Link style={style} to="/profil">Profil</Link> {/* TEST */}
                        </li>
                    </ul>
                </div>
            <Link to="/logout"><TbLogout /></Link>
            </div>
            
        </header>
    );
};
